import './App.css';

import React, {Component} from 'react'
import Navbar from './components/Navbar';
import Newss from './components/Newss';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
export default class App extends Component {

  render(){
    return (

      <div>
        <Router>
        <Navbar/>
        <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/news" element={<Newss />} />
          <Route exact path="/"><Newss pagesize={5} country="in" category="general"/> </Route>
          <Route exact path="business"><Newss pagesize={5} country="in" category="business"/> </Route>
          <Route exact path="entertainment"><Newss pagesize={5} country="in" category="entertainment"/> </Route>
          <Route exact path="general"><Newss pagesize={5} country="in" category="general"/> </Route>
          <Route exact path="health"><Newss pagesize={5} country="in" category="health"/> </Route>
          <Route exact path="science"><Newss pagesize={5} country="in" category="science"/> </Route>
          <Route exact path="sports"><Newss pagesize={5} country="in" category="sports"/> </Route>
          <Route exact path="technology"><Newss pagesize={5} country="in" category="technology"/> </Route>


        </Routes>
        </Router>
      </div>

    )

  }
}
